function cancelModalResetForm(t){$("[data-bs-dismiss='modal']").on("click",function(){t.resetForm()})}function submit(t,n,i){t.addEventListener("click",function(t){t.preventDefault(),i.validate().then(function(t){"Valid"===t&&Common.Ajax($(n).attr("method"),$(n).attr("action"),$(n).serializeArray())})})}function submitWithReturnHref(t,n,i,e){t.addEventListener("click",function(t){t.preventDefault(),i.validate().then(function(t){"Valid"===t&&Common.Ajax($(n).attr("method"),$(n).attr("action"),$(n).serializeArray(),null,function(){window.location.href=e})})})}module.exports={submit:submit,submitWithReturnHref:submitWithReturnHref};